import React from 'react';

const home = (props) => (
    <div className="main-content">
        <div className="container">
            <h2>{props.title}</h2>
            <div className="home-image"></div>
            <div className="thumbnail-container">
                <div className="home-thumbnail-1"></div>
                <div className="home-thumbnail-1"></div>
                <div className="home-thumbnail-1"></div>
            </div>
        </div>
    </div>
);

export default home;
